import React, { useState, useEffect } from 'react';
import '../styles/management.css';

const defaultList = [
  { name: 'Alicia', invitations: 8, total: 40000 },
  { name: 'Pedro', invitations: 4, total: 20000 },
  { name: 'Carmen', invitations: 3, total: 15000 },
];

export const Management = () => {
  const [list, setList] = useState([]);

  const onClickHandler = () => {
    console.log('pushed');
  };

  useEffect(() => {
    setList(defaultList);
  }, []);

  return (
    <div className={'management-mainContainer'}>
      <div className={'tableContainer'}>
        <div className={'tableHead'}>
          <div className={'col-1'}>Nombre completo</div>
          <div className={'col-2'}> Invitaciones</div>
          <div className={'col-3'}>Total recibido $</div>
        </div>
        {list &&
          list.map(({ name, invitations, total }) => (
            <div className={'tableRow'}>
              <div className={'col-1'}>{name}</div>
              <div className={'col-2'}>{invitations}</div>
              <div className={'col-3'}>{Number(total).toLocaleString()}</div>
            </div>
          ))}
      </div>
    </div>
  );
};
